import { useEffect } from 'react';
import Banner from "../../componentes/projetosApresentacao/projetos-inicio";
import ContatoForms from "../../componentes/contatoForms";
import useAnimateScroll from '../../hooks/useAnimateScroll';

export default function PaginaContato() {
  useAnimateScroll(); // Hook de animação ao rolar a página

  return (
    <section>
      <div data-animate="fade-up" className="delay-100">
        <Banner />
      </div>

      <div data-animate="fade-up" className="delay-300">
        <ContatoForms />
      </div>
    </section>
  );
}
